import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
  Input,
} from "antd";
import Link from "next/link";
const FormItem = Form.Item;
function ShowProfile() {
  return (<FormItem style={{width:"100%",height:"100%"}}>
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        width: "100%",
        height: "100%",
        background: "yellow",
      }}
    >
      
        <div
          style={{
            display: "flex",
            flexBasis: "auto",
            background: "red",
            padding: "10px",
            justifyContent: "center",
            alignItems: "center",
            width: "100%",
            height: "100%",
          }}
        >
          <box
            style={{ width: "250px", height: "250px", background: "white" }}
          />
        </div>
        <div
          style={{
            display: "flex",
            flexBasis: "auto",
            background: "blue",
            flexDirection: "column",
            padding: "10px",
            width: "100%",
            height: "100%",
          }}
        >
          <h3 style={{ fontSize: "18px" }}>ชื่อ สกุล</h3>
          <box className="nu-box-covid4">Name</box>
          <h3 style={{ fontSize: "18px" }}>หมายเลขประจำตัวประชาชน</h3>
          <box style={{ background: "white", padding: "10px" }}>SSID</box>
          <h3 style={{ fontSize: "18px" }}>วัน เดือน ปีเกิด</h3>
          <box style={{ background: "white", padding: "10px" }}>Birdday</box>
          <h3 style={{ fontSize: "18px" }}>รหัสไปรษณีย์</h3>
          <box style={{ background: "white", padding: "10px" }}>PostId</box>
        </div>
     
    </div> </FormItem>
  );
}
export default ShowProfile;
